import React from 'react';
import { CookiesProvider, useCookies } from 'react-cookie';
import RoutesComponent from './routes';
import './styles/global.css'


function App() {  
	const [cookies, setCookies ] = useCookies(['night-mode']);

  if (!cookies) {
    setCookies(false)
  }


  return (
    <CookiesProvider>
      <RoutesComponent />
    </CookiesProvider>
  );
}

export default App;
